import { useEffect, useState } from "react";
import api from "../api"

type Props = {
  categoryName: string;
};
export interface Question {
  id: string;
  name: string;
  description?: any;
  createdAt: Date;
  updatedAt: Date;
  categoryId: string;
}

export interface QuestionObject {
  name: string;
  questions: Question[];
  resposta: number;
}

export const MapQuestions =(categoryName:Props) => {
  const [questions, setQuestions] = useState<QuestionObject[]>();


  useEffect(() => {
    async function getCateriesWithQuestions() {
      const { data } = await api.get<QuestionObject[]>(
        `question?_category.name=${categoryName}`
      );
      setQuestions(data);
    }
    getCateriesWithQuestions();
    console.log(questions);
  }, []);

return (
    <form>
      {questions?.map((question, index) => {
        return (
        <div key={Math.random() + index * 2}>
              <div id="group1">
                <input type="radio" value="1" name="group1"></input>
                <input type="radio" value="2" name="group1"></input>
                <input type="radio" value="3" name="group1"></input>
                <input type="radio" value="4" name="group1"></input>
                <input type="radio" value="5" name="group1"></input>
              </div>
          </div>
        );
      })}
    </form>
  );


}
